import Header from "./Header";
const layoutStyle = {
    maxWidth:1000,
    margin: "auto",
    padding: 20,
    border: '1px solid #DDD',
  };
  
  const Layout = props => (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  );
  
  export default Layout;
